descriptions:
["DescriptionGulf Sotheby's International Realty is pleased to offer you this  contemporary 1 bedroom apartment in Wilton Park Residences, the latest launch by the Award-winning Boutique developer, Ellington Properties. Each Ellington development stands out for its superior design, enhanced features, and lifestyle within the community, representing one of the most unique and compelling options for both investors and end users.
Main Features:
. Contemporary design, high-end finishing;
. Heightened 3.2 m ceilings in Living rooms and Bedrooms; 
. Corner Unit with Elegantly proportioned windows with park views;
. Custom design kitchen cabinets with Built-in appliances, including premium, manufactured countertops and splash back;
. Finely crafted & fitted wardrobes and cabinets;
. Generous walk-in showers;
. Free WiFi in all common areas;
. Ellington's signature fragrance in the Lobby;
. Amenities include a Clubhouse, Gym, Swimming Pool, and Children Play area.
Location:
. 1 min to North London Collegiate School and Sobha Hartland International School.
. 3 min to the upcoming Meydan One Mall.
. Less than 10 min to Dubai Mall, DIFC and Downtown.
. 12 min to Dubai International Airport.
*images of the property may vary depending on the chosen layout. Estimated completion by Q2 2021.
Contact Gulf Sotheby's International Realty today for your private viewing of this extraordinary project."]
